    class Admin
    {
        private SuperMarket _superMarket = new SuperMarket();
        private Client _client = new Client();
     
        public void Menu()
        {
            const string –°onfirmation = "1";
            const string Exit = "2";

            bool isWork = true;

            while (isWork)
            {
                Console.WriteLine("–î–ï–ù–¨ –ù–ê–ß–ò–ù–ê–ï–¢–°–Ø, –ì–û–¢–û–í –ö –ü–†–û–î–ê–ñ–ê–ú?");
                Console.WriteLine("1.–í–ø–µ—Ä–µ–µ–¥");
                Console.WriteLine("2.–í—ã—Ö–æ–¥");

                Console.WriteLine("> ");
                string userInput = Console.ReadLine();

                if (userInput == –°onfirmation)
