    class SuperMarket
    {
        private Queue<Client> _clients = new Queue<Client>();
        private List<Product> _products = new List<Product>();

        public SuperMarket()
        {
            CreateListProducts();
            CreateQueueClients();
        }

        public int Profit { get; private set; }
        public int Sum { get; private set; }
       
        public void Sale(Client client)
        {
            ShowProducts();

            while (_clients.Count > 0)
            {
                Console.WriteLine("\n");
                
                client = _clients.Dequeue();

                client.ShowBasket();

                int totalSum = client.GetSum();

                Console.WriteLine("–ò—Ç–æ–≥–æ–≤–∞—è —Å—Ç–æ–∏–º–æ—Å—Ç—å - " + totalSum);

                if (client.Money >= totalSum)
                {
                    client.ReduceMoney(totalSum);
                    IncreaseMoney(totalSum);
                    
                    Console.WriteLine("–¢–æ–≤–∞—Ä –ø—Ä–æ–¥–∞–Ω –∫–ª–∏–µ–Ω—Ç –æ—Ç–ø—É—â–µ–Ω\n");
                    Console.WriteLine("–ü—Ä–∏–Ω–∏–º–∞–µ–º —Å–ª–µ–¥—É—é—â–µ–≥–æ? –î–ª—è —ç—Ç–æ–≥–æ –Ω–∞–∂–º–∏—Ç–µ –ª—é–±—É—é –∫–Ω–æ–ø–∫—É");

                    Console.ReadKey();
                    Console.Clear();
                }
                else
                {
                    client.RemoveFromBasket(totalSum);
                }
            } 
        }

        public void ShowResults()
        {
            Console.WriteLine("–ò—Ç–æ–≥–æ –º—ã –∑–∞—Ä–∞–±–æ—Ç–∞–ª–∏: " + Profit);
        }

        private void CreateListProducts()
        {
            _products.Add(new Product(25, "–•–ª–µ–±"));
            _products.Add(new Product(250, "–ì–æ–≤—è–¥–∏–Ω–∞"));
            _products.Add(new Product(200, "–ö—É—Ä–∏—Ü–∞"));
            _products.Add(new Product(195, "–ö–æ–ª–±–∞—Å–∞"));
            _products.Add(new Product(176, "–°–≤–∏–Ω–∞—è —Ç—É—à–µ–Ω–∫–∞"));
            _products.Add(new Product(74, "–ö–∏–ª–ª—å–∫–∞"));
            _products.Add(new Product(40, "–ñ–≤–∞—á–∫–∞"));
            _products.Add(new Product(58, "–°–Ω–∏–∫–µ—Ä—Å"));
            _products.Add(new Product(100, "–ì–∞–∑–∏—Ä–æ–≤–∫–∞"));
            _products.Add(new Product(80, "–ö–∞—Ä—Ç–æ—à–∫–∞ 1–∫–≥"));
            _products.Add(new Product(150, "–ü–æ–º–∏–¥–æ—Ä—ã 1–∫–≥"));
        }

        private void CreateQueueClients()
        {
            Random random = new Random();
            int maxValueClients = 25;
            int minValueClients = 3;

            int maxMoney = 5000;
            int minMoney = 500;

            int valueClients = random.Next(minValueClients, maxValueClients);
            int valueMoney = random.Next(minMoney, maxMoney);

            for (int i = 0; i < valueClients; i++)
            {
                Client client = new Client(valueMoney);

                client.FullBasket(_products);
                _clients.Enqueue(client);
            }

            ShowCountClients();
        }

        private void IncreaseMoney(int sum)
        {
            Profit += sum;
        }

        private void ShowProducts()
        {
            Console.WriteLine("–°–ø–∏—Å–æ–∫ –ø—Ä–æ–¥—É–∫—Ç–æ–≤ \n");

            foreach (Product product in _products)
            {
                Console.WriteLine($"{product.Name} - {product.Price}");
            }
        }

        private void ShowCountClients()
        {
            Console.WriteLine($"–ö–æ–ª–∏—á–µ—Å—Ç–≤–æ –∫–ª–∏–µ–Ω—Ç–æ–≤ - {_clients.Count()}");
        }
    }

    class Client
    {
        private List<Product> _basket = new List<Product>();
        private List<Product> _bag = new List<Product>();

        public Client(int money = 0)
        {
            Money = money;
        }

        public int Money { get; private set; }

        public void RemoveFromBasket(int sum)
        {
            for (int i = 0; i < _basket.Count; i++) 
            {
                while (Money < sum)
                {
                    int totalSum = sum - _basket[i].Price;
                    _basket.Remove(_basket[i]);

                    Console.WriteLine($"–ö–ª–∏–µ–Ω—Ç —É–±—Ä–∞–ª –∏–∑ –∫–æ—Ä–∑–∏–Ω—ã {_basket[i]} –Ω–∞ —Å—É–º–º—É {_basket[i].Price}");
                    Console.WriteLine($"–ò—Ç–æ–≥–æ–≤–∞—è —Å—Ç–æ–∏–º–æ—Å—Ç—å –∏–∑–º–µ–Ω–µ–Ω–∞ - {totalSum}");
                }

                Console.WriteLine("–£ –∫–ª–∏–µ–Ω—Ç–∞ –µ—Å—Ç—å –Ω—É–∂–Ω–∞—è —Å—É–º–º–∞ –¥–ª—è –æ–ø–ª–∞—Ç—ã");
            }
        }

        public void Buy()
        {
            for (int i = 0; i < _basket.Count; i++)
            {
                _bag.Add(_basket[i]);

                Console.WriteLine("–í—Å–µ —Ç–æ–≤–∞—Ä—ã —Å—É–º–∫–µ —É –∫–ª–∏–µ–Ω—Ç–∞. –•–æ—Ä–æ—à–µ–≥–æ –¥–Ω—è =)");
            }
        }

        public List<Product> FullBasket(List<Product> products)
        {
            List<Product> products1;

            products1 = products;

            Random random = new Random();
            int minValue = 2;
            int maxValue = 11;

            int numberCount = random.Next(minValue, maxValue);

            for (int i = 0; i < numberCount; i++)
            {
                Product randomObject = products1[random.Next(products.Count)];

                _basket.Add(randomObject);
            }

            return _basket;
        }

        public void ShowBasket()
        {
            Console.WriteLine("–ö–æ—Ä–∑–∏–Ω–∞ –∫–ª–∏–µ–Ω—Ç–∞ \n");

            foreach (Product product in _basket)
            {
                Console.WriteLine($"{product.Name} - {product.Price} —Ä—É–±.");
            }
        }

        public int GetSum()
        {
            int sum = _basket.Sum(product => product.Price);

            return sum;
        }

        public void ReduceMoney(int sum)
        {
            sum = GetSum();

            Money -= sum;
        }
    }

    class Product
    {
        public Product(int price, string name) 
        { 
            Price = price;
            Name = name;
        }

        public int Price { get; private set; }
        public string Name { get; private set; }
    }
}

using System;
using System.Windows.Forms;
using System.Data.SqlClient;

namespace PharmacyDubak
{
    public partial class AuthorizationForm : Form
    {
        private DataBaseConnection _dataBaseConnection;
        private bool _isPasswordShow = false;

        public AuthorizationForm()
        {
            InitializeComponent();
            _dataBaseConnection = new DataBaseConnection();
        }

        private void LoginButton_Click(object sender, EventArgs e)
        {
            string login = LoginTextBox.Text;
            string password = PasswordTextBox.Text;

            if (IsValidUser(login, password))
            {
                MessageBox.Show("–í—ã —É—Å–ø–µ—à–Ω–æ –≤–æ—à–ª–∏!", "–£—Å–ø–µ—à–Ω–æ!", MessageBoxButtons.OK, MessageBoxIcon.Information);
                MainForm mainForm = new MainForm();
                mainForm.Show();
                Hide();
            }
            else
            {
                MessageBox.Show("–í—ã –≤–≤–µ–ª–∏ –Ω–µ–≤–µ—Ä–Ω–æ –ª–æ–≥–∏–Ω –∏–ª–∏ –ø–∞—Ä–æ–ª—å!", "–ù–µ—É–¥–∞—á–∞!", MessageBoxButtons.OK, MessageBoxIcon.Information);
            }
        }

        private bool IsValidUser(string username, string password)
        {
            string query = "IF EXISTS (SELECT * FROM sys.sql_logins WHERE name = @username AND PWDCOMPARE(@password, password_hash) = 1) SELECT 1 ELSE SELECT 0";
            SqlCommand command = new SqlCommand(query, _dataBaseConnection.GetConnection());
            _dataBaseConnection.OpenConnection();
            command.Parameters.AddWithValue("@username", username);
            command.Parameters.AddWithValue("@password", password);
            int result = (int)command.ExecuteScalar();
            return result == 1;
        }

        private void RegistrationLinkClicked(object sender, LinkLabelLinkClickedEventArgs e)
        {
            LoginButton.Enabled = false;
            LoginButton.Visible = false;
            LoginTextBox.Text = "";
            PasswordTextBox.Text = "";
        }

        private void LoginLinkClicked(object sender, LinkLabelLinkClickedEventArgs e)
        {
            LoginButton.Visible = true;
            LoginButton.Enabled = true;
            LoginTextBox.Text = "";
            PasswordTextBox.Text = "";
        }

        private void button1_Click(object sender, EventArgs e)
        {
            if (_isPasswordShow == false)
            {
                PasswordTextBox.PasswordChar = default;
                _isPasswordShow = true;
                Shower.Text = "O";
            }
            else
            {
                PasswordTextBox.PasswordChar = '*';
                _isPasswordShow = false;
                Shower.Text = "√ò";
            }
        }
    }
}

