class Solution:
    def compareVersion(self, version1: str, version2: str) -> int:
        v1=[]
        v2=[]
        s = ("")
        for i in version1:
            if(i == '.'):
                v1.append(int(s))
                s = ("")
            else:
                s += i
        v1.append(int(s))
        s = ("")
        for i in version2:
            if(i == '.'):
                v2.append(int(s))
                s = ("")
            else:
                s += i
        v2.append(int(s))
        n, m = len(v1), len(v2)
        if(m > n):
            for i in range(m - n):
                v1.append(0)
        elif(n > m):
            for i in range(n - m):
                v2.append(0)
        for i in range(max(n, m)):
            if(v1[i] > v2[i]):
                return 1
            elif(v2[i] > v1[i]):
                return -1
        return 0
